import React from 'react';
import './Results.css';

import 'bootstrap/dist/css/bootstrap.min.css';

function Results() {
  return (
    <div className="Results">
      <header className="Results-header">
        <div className="Results-display">
        Results will be displayed here
        </div>
      </header>
    </div>
  );
}

export default Results;
